import React, {Component} from "react";
import "./Feed.css";
import StoryReel from "./StoryReel";
import MessageSender from "./MessageSender";
import Post from "./Post";
import  * as actionCreators from './store/actionCreators';
import {connect} from "react-redux";

class Feed extends Component{
  render(){
    return (
        <div className="feed">
          <StoryReel />
          <MessageSender />
          {
            this.props.articleList.map((item) => {
              return(
                  <Post
                      profilePic="/logo.png"
                      desc={item.desc}
                      timestamp={item.timestamp}
                      username={item.username}
                      imgUrl={item.imgUrl}
                  />
              )
            })
          }
          <Post
            profilePic="/logo.png"
            message="wow this works!wow this works!wow this works!wow this rks!wow this works!wow this works!wow this rks!wow this works!wow this works!wow this rks!wow this works!wow this works!wow this rks!wow this works!wow this works!wow this rks!wow this works!wow this works!wow this rks!wow this works!wow this works!wow this rks!wow this works!wow this works!wow this rks!wow this works!wow this works!wow this rks!wow this works!wow this works!wow this works!wow this works!wow this works!wow this works!wow this works!wow this works!"
            timestamp={this.props.articleList}
            username="chen"
            image="https://code.org/shared/images/social-media/codeorg2019_social.png"
          />
          <Post
              profilePic=""
              message="wow this works!"
              timestamp="This is a timestamp"
              username="X"
          />

        </div>
    );
  }
}

const mapStateToProps = (state) =>{
  return{
    // 第一个get('login')指的是login中的store中的reducer
    articleList: state.get('feed').get('articleList')
  }
}

const mapDispatchToProps = (dispatch) =>{
  return{
    click1(login,accountElem, passwordElem){
      if (!login){
        //dispatch(actionCreators.logIn());
        dispatch(actionCreators.getList(accountElem.value, passwordElem.value));
        console.log('logggg');
        console.log(accountElem);
      }
      else console.log('error');

    }
  }
}

export default connect(mapStateToProps,mapDispatchToProps)(Feed);
